import logo from "./logo.svg";
import "./App.css";
import Section from "./components/Section";
import Toast from "./components/Toast";

function App() {
  const messageArray = [
    {
      title: "success",
      text: "Right On!",
    },
    {
      title: "success",
      text: "Right On!",
    },
    {
      title: "warning",
      text: "Hmmm",
    },
    {
      title: "warning",
      text: "Hmmm",
    },
    {
      title: "error",
      text: "Un Oh!",
    },
    {
      title: "error",
      text: "Un Oh!",
    },
  ];

  return (
    <div className="wrapper">
      {messageArray.map((message) => (
        <Toast title={message.title} text={message.text} />
      ))}
      {/* props를넣어준부분 */}
    </div>
  );
}

export default App;
